__NUXT_JSONP__("/gallery/sinsemilia", (function(a,b,c,d){return {data:[{document:{date:a,title:[{type:"heading3",text:"Sinsemilia",spans:[]}],photo:{dimensions:{width:c,height:c},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fc87cf73b-5ebe-4a51-887b-e9bcd0c2107c_Sinsemilia.jpg?auto=compress,format&rect=0,0,2000,2000&w=800&h=800",small:{dimensions:{width:d,height:d},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fc87cf73b-5ebe-4a51-887b-e9bcd0c2107c_Sinsemilia.jpg?auto=compress,format&rect=0,0,2000,2000&w=320&h=320"}},content:[{type:b,text:"I work in a recording studio and the French reggae group  Sinsemilia were posing in a vintage T-Bird in the parking lot. I used  Photoshop to put them in the Painted Desert with a couple of crows from  the Rocky Mountains and a no-swimming sign from the Florida Everglades.  The bumper reflected the cobble stones from the parking lot so I had to  clone in some desert floor to make it plausible. The Belgian license  plate was changed to spell the title of their album, Tout C'Qu'On A, pronounced too-skon-ah (meaning “all we’ve got”)",spans:[{start:471,end:485,type:"em"}]},{type:b,text:"I  made it a square format so they could use it for their CD cover, but  alas, even though they really dug the picture, they’d already arranged  the artwork. Grin & bear it... ",spans:[]},{type:b,text:"All elements shot with Canon EOS 100 + EF 28-80 USM on Fuji Reala 100 ISO color print film.",spans:[]},{type:b,text:"Processing done in Photoshop 6.0.",spans:[]}],page:"Page 1",tag:"montage"}}],fetch:[],mutations:void 0}}(null,"paragraph",800,320)));